import React from 'react';
import { Route, Routes } from 'react-router-dom';
import "@fortawesome/fontawesome-free/css/all.min.css";


function App() {
  return (
    <Routes>
      <Route
        path="/"
        element={
          <>
            <Header />
            {/* <Navbar /> */}
            <Banner />
            <Home />
            <Footer />
          </>
        }
      />
      <Route
        path="/id"
        element={
          <>
            <Header />
            <Navbar />
            <Product />
            <Footer />
          </>
        }
      />
      <Route
        path="/giohang"
        element={
          <>
            <Header />
            <Navbar />
            <Shoppingcart />
            <Footer />
          </>
        }
      />
      <Route path="*" element={<NotFound />} />
    </Routes>
  );
}

export default App;
